def solution():
    # Since the roots are negative integers and the product of the roots (c/a) is 36,
    # we need to find all pairs of factors of 36 that are both negative.
    factors = []
    for i in range(-1, -37, -1):
        if 36 % i == 0:
            factors.append(i)

    # The sum of the roots (-b/a) should be an integer, and since the roots are distinct,
    # we calculate the sums of each pair and ensure they are distinct.
    distinct_sums = set()
    for i in range(len(factors)):
        for j in range(i + 1, len(factors)):
            if factors[i] * factors[j] == 36:
                distinct_sums.add(-(factors[i] + factors[j]))

    return sum(distinct_sums)

