def solution():
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    def greatest_prime_factor(n):
        largest_prime = -1
        while n % 2 == 0:
            largest_prime = 2
            n //= 2
        for i in range(3, int(n**0.5) + 1, 2):
            while n % i == 0:
                largest_prime = i
                n //= i
        if n > 2:
            largest_prime = n
        return largest_prime

    def p(x):
        floor_x = int(x)
        if is_prime(floor_x):
            return x + 1
        else:
            y = greatest_prime_factor(floor_x)
            return p(y) + (x + 1 - floor_x)

    results = set()
    for x in [i / 10.0 for i in range(20, 101)]:
        results.add(p(x))

    return f"[{min(results)}, {max(results)}]"

